import logo from './logo.svg';
import './App.css';


function MyButton() {
  return (
    <button>I'm a button</button>
  );
}

function App() {
  return (
    <><div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    <div>
        <MyButton />
    </div></>
  );
}

export default App;
